INSERT INTO `jg_content_pages` (`pageid`, `slug`, `content`, `lastmodified`) VALUES
(15, 'WHO WE ARE', '<p style=\"padding-left:25px;\">In our busy lives, it\'s easy to become overwhelmed and lose focus on what\'s best for ourselves. It can be hard to get back on the road to wellness, mentally and physically. Heal Mind &amp; Body is here to change that with our incredibly simple, intuitive platform that keeps you organized and on track on your healing journey.</p>', '2019-11-14 05:53:57'),
(34, 'NUTRITION', 'You are what you eat, as the old saying goes. Keep track of what goes into your body with our calorie log.', '2018-06-18 13:24:56'),
(35, 'MEDITATION', 'Feeling stressed? Overwhelmed? Tired? Angry? Take a moment to calm your mind and get in touch with your inner self.', '2018-06-18 13:24:56'),
(36, 'TASK MANAGEMENT', 'Tasks build up and create stress. Clear your mind and accomplish your goals.', '2018-06-18 13:24:56'),
(37, 'GROUPS', 'Sometimes it takes a village to heal. Join up with others interested in related areas of healing and encourage each other.', '2018-06-18 13:24:56'),
(29, 'CLINICS', '<p>By utilizing Heal Mind &amp; Body, your clinic will have the tools needed to enhance patient-care with unlimited service that continues even after your patients have left the clinic.</p>', '2019-07-17 08:02:41'),
(30, 'MEMBERS', '<p>Do you need a change? Develop personally, overcome any issue, and take back control of your life with Heal Mind &amp; Body.</p>', '2019-07-17 08:03:11'),
(31, 'A WORD FROM OUR FOUNDER', ' <h2>What is HealMB?</h2>\r\n          <p>Listen as HealMB founder Nadeem Khan walks through everything our platform has to offer!</p>', '2019-01-08 12:13:10'),
(32, 'HOW TO HEAL', 'Explore the many tools and resources we offer and start healing, both mind and body.', '2018-06-18 13:24:56'),
(33, 'EXERCISE', 'The importance of fitness to overall health and happiness cannot be overstated. Transform your body with these simple routines.', '2018-06-18 13:24:56'),
(38, 'CHAT', '<p>Need to contact a specific patient? Want to talk to others on the path to wellness? Chat with others 7 using Heal Mind &amp; Body, and share inspiration and successes.</p>', '2019-07-17 08:03:57'),
(39, 'CHALLENGES', 'Push yourself further and further for personal growth and health by accepting a challenge or hosting one yourself.', '2018-06-18 13:24:56'),
(40, 'VIDEO', 'From therapy to exercise to motivational speeches, enjoy a wide variety of videos to focus your mind anytime.', '2018-09-19 12:17:22'),
