(43, 30, 'Absolute Yoga - Checklist', 'Yoga is something different to most people. Its quite diverse,\r\nand practitioners have different expectations when they start.\r\nThats perfectly okay. Whether your goal is greater\r\nenlightenment, a more toned and muscular body, or relief from\r\ndisease, theres a yoga for you. This checklist will run you\r\nthrough the simple tips and techniques to become the better\r\nversion of yourself.', 'AY_Checklist1.pdf', 'Document', '', 0, 2),
