(58, 29, 'Mindful Meditation - Checklist', 'Mindful meditation isnt magic. It allows you to concentrate your\r\nawareness on the here and now. It increases our mental energy,\r\nallowing us to perform better and achieve more. Quite simply,\r\nmindful meditation makes us more efficient in many areas of our\r\nlives. This checklist will run you through the simple steps and\r\nstrategies to know the real you and reaching your full potential.', 'MM_Checklist1.pdf', 'Document', '', 0, 2),
