(13, 3, 1, 'paragraph', 'Your score suggests that anxiety has started to get in the way of how you live your daily life. Dont be alarmed, this is very common and there are things you can do to improve your situation. There are different levels of anxiety and yours can change from day to day. But its important to seek help early. The sooner you talk to someone, the sooner youll be on the road to recovery.'),
