INSERT INTO `jg_test_results` (`id`, `test_id`, `points_from`, `points_to`, `condition_name`, `result`) VALUES
(1, 2, 0, 5, 'Low Anxiety', '\r\n\r\n    <p class=\"take-pre \">\r\n\r\n        Your score falls into the low range. Some anxiety can be good  it can help us react to potential threats, perhaps by quickening our reflexes or focusing our attention, and it usually passes once the stressful situation has passed. Even though you might be feeling awful it looks like youre having a normal reaction to a tough situation. You can do some things to help yourself feel a bit better.\r\n\r\n         </p>\r\n\r\n    <h4 class=\"take-subheading\">VIDEO (What is anxiety?) </h4>\r\n\r\n    <div class=\"embed-responsive embed-responsive-16by9\">\r\n        <iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/4MQMMwqdgAY\" allowfullscreen=\"\"></iframe>\r\n    </div>\r\n\r\n\r\n    <h4 class=\"take-subheading\">MEDITATION</h4>\r\n\r\n    <iframe width=\"100%\" height=\"166\" scrolling=\"no\" frameborder=\"no\" allow=\"autoplay\" src=\"https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/564250119%3Fsecret_token%3Ds-k7DYs&color=%23bcb4cc&auto_play=false&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true\"></iframe>\r\n\r\n\r\n\r\n    <a class=\"default-btn-style test-result-btn\"  href=\"https://healmb.com/classes\" >EXPLORE CLASSES</a>'),
(2, 2, 6, 11, 'Mild Anxiety', '\r\n\r\n    <p class=\"take-pre \">\r\n\r\n        Your score shows you have some mild signs of anxiety. Maybe youre in the middle of a stressful time, and your mind is responding to this. Chances are your anxiety will improve as time goes on, but it might be worth keeping an eye on how the anxietys impacting on your life.\r\n         </p>\r\n\r\n    <h4 class=\"take-subheading\">VIDEO (What is anxiety?) </h4>\r\n\r\n    <div class=\"embed-responsive embed-responsive-16by9\">\r\n        <iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/4MQMMwqdgAY\" allowfullscreen=\"\"></iframe>\r\n    </div>\r\n\r\n\r\n    <h4 class=\"take-subheading\">MEDITATION</h4>\r\n\r\n    <iframe width=\"100%\" height=\"166\" scrolling=\"no\" frameborder=\"no\" allow=\"autoplay\" src=\"https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/564250119%3Fsecret_token%3Ds-k7DYs&color=%23bcb4cc&auto_play=false&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true\"></iframe>\r\n\r\n    <a class=\"default-btn-style test-result-btn\"  href=\"https://healmb.com/tasks\" >TASK MANAGEMENT</a>\r\n\r\n    <a class=\"default-btn-style test-result-btn\"  href=\"https://healmb.com/classes\" >EXPLORE CLASSES</a>\r\n'),
(3, 2, 12, 16, 'Medium Anxiety', '\r\n    <p class=\"take-pre \">\r\n\r\n        Your score suggests that anxiety has started to get in the way of how you live your daily life. Dont be alarmed, this is very common and there are things you can do to improve your situation. There are different levels of anxiety and yours can change from day to day. But its important to seek help early. The sooner you talk to someone, the sooner youll be on the road to recovery.\r\n\r\n    </p>\r\n\r\n    <h4 class=\"take-subheading\">VIDEO (What is anxiety?) </h4>\r\n\r\n    <div class=\"embed-responsive embed-responsive-16by9\">\r\n        <iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/4MQMMwqdgAY\" allowfullscreen=\"\"></iframe>\r\n    </div>\r\n\r\n\r\n    <h4 class=\"take-subheading\">MEDITATION</h4>\r\n\r\n    <iframe width=\"100%\" height=\"166\" scrolling=\"no\" frameborder=\"no\" allow=\"autoplay\" src=\"https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/564250119%3Fsecret_token%3Ds-k7DYs&color=%23bcb4cc&auto_play=false&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true\"></iframe>\r\n\r\n    <h4 class=\"take-subheading\">THERAPY</h4>\r\n\r\n    <iframe width=\"100%\" height=\"166\" scrolling=\"no\" frameborder=\"no\" allow=\"autoplay\" src=\"https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/569981577%3Fsecret_token%3Ds-xtMXr&color=%23bcb4cc&auto_play=false&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true\"></iframe>\r\n    <a class=\"default-btn-style test-result-btn\"  href=\"https://healmb.com/tasks\" >TASK MANAGEMENT</a>\r\n\r\n   '),
(4, 2, 17, 21, 'High Anxiety', '\r\n    <p class=\"take-pre \">\r\n\r\n        Your score falls into the high range - anxiety has probably gotten in the way of you going to work, meeting friends, or doing the stuff that matters to you. This isnt a diagnosis, but it looks like its time to get help.\r\n    </p>\r\n\r\n    <h4 class=\"take-subheading\">VIDEO (What is anxiety?) </h4>\r\n\r\n    <div class=\"embed-responsive embed-responsive-16by9\">\r\n        <iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/4MQMMwqdgAY\" allowfullscreen=\"\"></iframe>\r\n    </div>\r\n\r\n    <p class=\"padding-top\">Contact us to schedule an in-person appointment</p>\r\n\r\n    <a class=\"default-btn-style test-result-btn\"  href=\"https://healmb.com/contact\" >Contact Us</a>\r\n\r\n\r\n    <h4 class=\"take-subheading\">MEDITATION</h4>\r\n\r\n    <iframe width=\"100%\" height=\"166\" scrolling=\"no\" frameborder=\"no\" allow=\"autoplay\" src=\"https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/564250119%3Fsecret_token%3Ds-k7DYs&color=%23bcb4cc&auto_play=false&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true\"></iframe>\r\n\r\n    <h4 class=\"take-subheading\">THERAPY</h4>\r\n\r\n    <iframe width=\"100%\" height=\"166\" scrolling=\"no\" frameborder=\"no\" allow=\"autoplay\" src=\"https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/569981577%3Fsecret_token%3Ds-xtMXr&color=%23bcb4cc&auto_play=false&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true\"></iframe>\r\n\r\n    <a class=\"default-btn-style test-result-btn\"  href=\"https://healmb.com/tasks\" >TASK MANAGEMENT</a>\r\n'),
(5, 1, 0, 6, 'Low Depression', '\r\n    <p class=\"take-pre \">\r\n\r\n        Thanks for taking time to complete the questions. While you might be feeling down right now, youre not showing signs of depression. Those low feelings should go away as the problem passes, but you can help thing along by trying some of the ideas below:\r\n\r\n       </p>\r\n\r\n    <h4 class=\"take-subheading\">VIDEO (What is depression?)  </h4>\r\n\r\n    <div class=\"embed-responsive embed-responsive-16by9\">\r\n        <iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/50-7uTvleDs\" allowfullscreen=\"\"></iframe>\r\n    </div>\r\n\r\n\r\n    <h4 class=\"take-subheading\">MEDITATION</h4>\r\n\r\n    <iframe width=\"100%\" height=\"166\" scrolling=\"no\" frameborder=\"no\" allow=\"autoplay\" src=\"https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/564250119%3Fsecret_token%3Ds-k7DYs&color=%23bcb4cc&auto_play=false&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true\"></iframe>\r\n\r\n \r\n\r\n    <a class=\"default-btn-style test-result-btn\"  href=\"https://healmb.com/classes\" >EXPLORE CLASSES</a>\r\n\r\n'),
(6, 1, 7, 13, 'Medium Depression', '\r\n    <p class=\"take-pre \">\r\n\r\n        If youre having thoughts most days about hurting or killing yourself, please reach out straight away and talk to someone whos trained to help. Even if you feel like no one in the world gets you right now, there are people who can support you. These thoughts are common in depression, but if you find they are getting more frequent (most days) or you feel more like acting on them  call us straight away.\r\n       </p>\r\n\r\n    <h4 class=\"take-subheading\">VIDEO (What is depression?)  </h4>\r\n\r\n    <div class=\"embed-responsive embed-responsive-16by9\">\r\n        <iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/50-7uTvleDs\" allowfullscreen=\"\"></iframe>\r\n    </div>\r\n\r\n    <p class=\"padding-top\">Suicide prevention hotline - 1-800-273-8255</p>\r\n\r\n    <p class=\"padding-top\">Contact us to schedule an in-person appointment</p>\r\n\r\n\r\n    <a class=\"default-btn-style test-result-btn\"  href=\"https://healmb.com/contact\" >Contact Us</a>\r\n\r\n\r\n\r\n    <h4 class=\"take-subheading\">MEDITATION</h4>\r\n\r\n    <iframe width=\"100%\" height=\"166\" scrolling=\"no\" frameborder=\"no\" allow=\"autoplay\" src=\"https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/564250119%3Fsecret_token%3Ds-k7DYs&color=%23bcb4cc&auto_play=false&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true\"></iframe>\r\n\r\n\r\n    <h4 class=\"take-subheading\">THERAPY</h4>\r\n\r\n    <iframe width=\"100%\" height=\"166\" scrolling=\"no\" frameborder=\"no\" allow=\"autoplay\" src=\"https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/569981577%3Fsecret_token%3Ds-xtMXr&color=%23bcb4cc&auto_play=false&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true\"></iframe>\r\n'),
