(9, 3, 0, 150, 'Light Stress', '\r\n    <h2 class=\"take-heading\">LIGHT/MODERATE STRESS</h2>\r\n\r\n\r\n    <p class=\"take-pre \">\r\n\r\n        You likely have a number of stressors in your life causing your current state of mind. Though it may be difficult to imagine now, you can find some relief to the pressure you feel right now! Try a few of our recommendations below.\r\n    </p>\r\n\r\n    <h4 class=\"take-subheading\">VIDEO (What is stress?)</h4>\r\n\r\n    <div class=\"embed-responsive embed-responsive-16by9\">\r\n        <iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/Wp9s7MG5f3I\" allowfullscreen=\"\"></iframe>\r\n    </div>\r\n\r\n\r\n    <h4 class=\"take-subheading\">MEDITATION</h4>\r\n\r\n    <iframe width=\"100%\" height=\"166\" scrolling=\"no\" frameborder=\"no\" allow=\"autoplay\" src=\"https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/564250119%3Fsecret_token%3Ds-k7DYs&color=%23bcb4cc&auto_play=false&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true\"></iframe>\r\n\r\n\r\n    <a class=\"default-btn-style test-result-btn\"  href=\"https://healmb.com/classes\"  >Explore Classes</a>\r\n\r\n    <a class=\"default-btn-style test-result-btn\"  href=\"https://healmb.com/tasks\"  >Task Management</a>\r\n\r\n'),
(10, 3, 150, 299, 'High Stress', '\r\n    <h2 class=\"take-heading\">HIGH STRESS</h2>\r\n\r\n\r\n    <p class=\"take-pre \">\r\n\r\n        You are currently experiencing a high level of stress in your life. These moments inevitably come in life, and all we can do is try to move forward and weather the storm the best we can. Follow some of our recommendations below to find some relief, but youre not in this alone. If you need any help, dont hesitate to reach out to talk to somebody.\r\n\r\n    </p>\r\n\r\n    <h4 class=\"take-subheading\">VIDEO (What is stress?)</h4>\r\n\r\n    <div class=\"embed-responsive embed-responsive-16by9\">\r\n        <iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/Wp9s7MG5f3I\" allowfullscreen=\"\"></iframe>\r\n    </div>\r\n\r\n\r\n    <h4 class=\"take-subheading\">MEDITATION</h4>\r\n\r\n    <iframe width=\"100%\" height=\"166\" scrolling=\"no\" frameborder=\"no\" allow=\"autoplay\" src=\"https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/564250119%3Fsecret_token%3Ds-k7DYs&color=%23bcb4cc&auto_play=false&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true\"></iframe>\r\n\r\n\r\n    <h4 class=\"take-subheading\">THERAPY </h4>\r\n\r\n    <iframe width=\"100%\" height=\"166\" scrolling=\"no\" frameborder=\"no\" allow=\"autoplay\" src=\"https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/569981577%3Fsecret_token%3Ds-xtMXr&color=%23bcb4cc&auto_play=false&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true\"></iframe>\r\n\r\n    <a class=\"default-btn-style test-result-btn\"  href=\"https://healmb.com/tasks\"  >Task Management</a>'),
(11, 3, 300, 1406, 'Severe Stress', '\r\n    <h2 class=\"take-subheading\">SEVERE STRESS</h2>\r\n\r\n\r\n    <p class=\"take-pre \">\r\n\r\n        Your current stress level is overwhelming and potentially dangerous to your health. Review our steps below to find some temporary relief, but its very likely youll need others to help you through what is clearly a difficult period in your life. Dont hesitate to reach out and schedule an appointment with us to talk to somebody and find a way through this.\r\n    </p>\r\n\r\n    <h4 class=\"take-subheading\">VIDEO (What is stress?)</h4>\r\n\r\n    <div class=\"embed-responsive embed-responsive-16by9\">\r\n        <iframe class=\"embed-responsive-item\" src=\"https://www.youtube.com/embed/Wp9s7MG5f3I\" allowfullscreen=\"\"></iframe>\r\n    </div>\r\n\r\n    <p> Contact us to schedule an in-person appointment</p>\r\n\r\n    <a class=\"default-btn-style test-result-btn\"  href=\"https://healmb.com/contact\"  >Contact Us</a>\r\n\r\n\r\n    <h4 class=\"take-subheading\">MEDITATION</h4>\r\n\r\n    <iframe width=\"100%\" height=\"166\" scrolling=\"no\" frameborder=\"no\" allow=\"autoplay\" src=\"https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/564250119%3Fsecret_token%3Ds-k7DYs&color=%23bcb4cc&auto_play=false&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true\"></iframe>\r\n\r\n\r\n    <h4 class=\"take-subheading\">THERAPY </h4>\r\n\r\n    <iframe width=\"100%\" height=\"166\" scrolling=\"no\" frameborder=\"no\" allow=\"autoplay\" src=\"https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/569981577%3Fsecret_token%3Ds-xtMXr&color=%23bcb4cc&auto_play=false&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true\"></iframe>\r\n\r\n    <a class=\"default-btn-style test-result-btn\"  href=\"https://healmb.com/tasks\"  >Task Management</a>\r\n');
